import './App.css';

function App() {
  return (
    <div className="App" style={{ fontFamily: 'Arial, sans-serif', padding: '2rem' }}>
      <header style={{ backgroundColor: '#ff69b4', color: 'white', padding: '1rem', borderRadius: '8px' }}>
        <h1>Go Tripping</h1>
        <p>Explore top destinations near you and chat with fellow travelers!</p>
       </header>

      <main style={{ marginTop: '2rem' }}>
        <h2>Welcome to Go Tripping</h2>
        <p>Start by selecting a province and a radius to find interesting spots near you.</p>
      </main>
    </div>
  );
}

export default App;



